import React from "react";

const Signin = () => {
    return (
        <div
            style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                height: '100vh'
                
            }}
        >
            <h1 className="is-size-2">Sign in Page</h1>
        </div>
    );
};

export default Signin;
